import Signup from './Signup'
import Login from './Login'

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Login />
      <Navbar>Soniya kukreja</Navbar>
      <Signup />
     <Home/>
    </div>
  );
}

export default App;
